  false,\n\t\"url\": null,\n\t\"notes\": \"A vegetation layer created by Aerial Information
  Systems (AIS) for Joshua Tree National Park (JOTR) in the late 1990's. Since the
  initial work, an accuracy assessment (AA) was conducted during 2007 and 2008, in
  addition to a rapid assessment (RA) during 2009. Data collected through the AA and
  RA not only gauged the accuracy of the AIS's aerial photo interpretation but also
  the initial in-field vegetation key written by JOTR. The AA and RA data was further
  used in validating changes to both the vegetation layer's attribute information
  and polygon geometry. This feature class serves as the final version of the vegetation
  layer after changes based off of the AA and RA. USE THIS VEGETATION LAYER TO REPRESENT
  JOTR.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
